import React,{useState} from 'react'
import "./App.css"

const Login=()=>{
    const [emailLog,setEmailLog] = useState("");
    const [passwLog,setPasswLog] = useState("");

    const [emailReg,setEmailReg] = useState("");
    const [passwReg,setPasswReg] = useState("");
    const [name,setName] = useState("")

    const[dataInput, setDataInput]=useState("");

    const submitThis=()=>{
        const info={emailLog:emailLog,passwLog:passwLog};
        setDataInput([info]);
    }
    const submitRegister=()=>{
        const info={emailReg:emailReg, passwReg:passwReg, name:name};
        setDataInput([info])
    }

    return(
        <div className="app">
            <h1>Numele aplicatiei</h1>
            <form onSubmit={submitThis}>
            <div className="input-container">
                <label>Email </label>
                    <input
                            type="text"
                            name="email"
                            placeholder="Email"
                            value={emailLog} onChange={(e)=>setEmailLog(e.target.value)}
                            required
                           />

                      </div>
                      <div className="input-container">
                        <label>Password </label>
                        <input
                            type="password"
                            name="password"
                            placeholder="Password"
                            value={passwLog} onChange={(e)=>setPasswLog(e.target.value)}
                            required />

                      </div>
                      <div className="button-container">
                        <button type="buton">Log in</button>
                      </div>
                    </form>
                  </div>
    )

}

export default Login
